import React from 'react';


class GallaryPanel extends React.Component {
  render() {

    const styles={
      width: "90%",
      margin: "10px auto",
      height:"500px",
      border: "solid 2px blue",
      overflow: "scroll",
      display: "flex",
      flexWrap: "wrap",
      justifyContent: "space-around",
    };

    const i={
      background: "gray",
      height:"300px",
      flexBasis: "48%",
      marginTop: "10px"
    }

    return (
      <section className="section-gallalypanel section-bottom">
       <input type="search" placeholder="looking for..."/>
       <div className="gallaryframe" style={styles}>
         <div className="svg-item" style={i}></div>
         <div className="svg-item" style={i}></div>
         <div className="svg-item" style={i}></div>
         <div className="svg-item" style={i}></div>
         <div className="svg-item" style={i}></div>
       </div>
      </section>
    );

}
}

export default GallaryPanel;
